import React from "react";
import "../css/SubHeader.css";
function SubHeader() {
  return (
    <div className="subheader">
      <div>
        <span className="subheader-dropdown">Dropdown</span>
      </div>
      <div>
        <span className="subheader-dropdown">Dropdown</span>
      </div>
      <div>
        <span className="subheader-dropdown">Dropdown</span>
      </div>
      <div>
        <span className="subheader-dropdown">Dropdown</span>
      </div>
    </div>
  );
}

export default SubHeader;
